import React, { useState } from 'react';
import { RiMenu3Line, RiCloseLine } from 'react-icons/ri';
import logo from '../../assets/logo.svg';
import './navbar.css';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuToggle = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className={`llm__navbar section__padding ${isMenuOpen ? 'menu-open' : ''}`}>
      <div className="llm__navbar-logo">
        <a href="#home">
          <img src={logo} alt='logo' />
        </a>
      </div>
      <div className="llm__navbar-toggle" onClick={handleMenuToggle}>
        {isMenuOpen ? <RiCloseLine /> : <RiMenu3Line />}
      </div>
      <div className={`llm__navbar-links ${isMenuOpen ? 'open' : ''}`}>
        <a href='#home'>Home</a>
        <a href="#about">About</a>
        <a href="#features">Features</a>
        <a href="#pricing">Pricing</a>
        <a href="#contact">Contact</a>
        <div className="llm__navbar-sign">
          <p>Log in</p>
          <button type="button">Create Free</button>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
